namespace BaiTapNhom
{
    /// <summary>
    /// Interaction logic for TraCuu.xaml
    /// </summary>
    public partial class TraCuu : Window
    {

        // Event nay
        // No public
        // De from ben kia lay duoc

        public event EventHandler<EventArgs> InputKeySuccess;
        // No se nhay qua day
        public TraCuu()
        {
            InitializeComponent();
            Icon = ChuyenDoi.BitMapImage("");
            ChuyenDoi.HinhAnh(imgBackGround, "");
        }

        private void btnTraCuu_Click(object sender, RoutedEventArgs e)
        {
             WindowState = WindowState.Minimized;

            // O day, em phai lay duoc. Em dang Filter theo tieu chi gi
            // A mac dinh CMND = 1
            // Ma NV = 2
            // SDT = 3
            // Vi du e thich 4,5,6 cung dc
            // Day la backend minh xu ly
            // Tiep theo minh phai luu duoc key User muon filter

            // a tao ra mot cai Events
            List<string> Input = new List<string>();
            
            if (rdoCMND.IsChecked == true)
            {
                Input.Add("1");
            }

            if (rdoMaNhanVien.IsChecked == true)
            {
                Input.Add("2");
            }

            if (rdoSoDienThoai.IsChecked == true)
            {
                Input.Add("3");
            }

            Input.Add(txtTraCuu.Text);

            // Khi thuc thi nut TimKiem
            // A truyen de lieu lai Form main
            // Cung voi Input = List<>
            // Tai Input nay la Object, Nen minh phai tao ra List de add 2 Property vao
            // Sau khi Event kich hoat
            InputKeySuccess?.Invoke(Input, EventArgs.Empty);
        }
    }
}
